ON CONFLICT (id) DO NOTHING;

-- 2. Insert status data
ON CONFLICT (id) DO NOTHING;

-- 3. Insert type data
ON CONFLICT (id) DO NOTHING;

-- 4. Insert token data
ON CONFLICT (id) DO NOTHING;

-- 5. Insert all station data
ON CONFLICT (id) DO NOTHING;

-- 6. Update sequences to match the data
